import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Exercise from "./pages/Exercise.js";
import Home from "./pages/Home.js";
import MovementEncyclopedia from "./pages/MovementEncyclopedia.js";
import MusclesEncylopedia from "./pages/MusclesEncylopedia.js";
import About from "./pages/About.js";
import Workouts from "./pages/Workouts.js";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Home />} />
          <Route path="/exercise" element={<Exercise />} />
          <Route path="/movement-encyclopedia" element={<MovementEncyclopedia />} />
          <Route path="/muscles-encyclopedia" element={<MusclesEncylopedia />} />
          <Route path="/about" element={<About />} />
          <Route path="/workouts" element={<Workouts />} />
          <Route exact path="*" element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
